void drvif_color_set_BOE_RGBW_FW_Action(bool Act)
{
	/*
	<Act = 0> FW suspend
	It will suspend all FW functions, except for interrupt handler.
	Step 1: SOC writes 0x10 to APB_C008.
	Step 2: SOC triggers the interrupt by pulling low the mcu_int_in.
	Step 3: Polling output interrupt io mcu_int_out.
	Step 4: Once SOC receives the RGBWIPs interrupt, it means that MCU execute FW suspend successful.
	SOC shall pull-up the mcu_int_in and clear APB_C008=0x00 to end this communication.

	<Act = 1> FW resume
	Resume FW to main functions.
	Step 1: SOC writes 0x11 to APB_C008.
	Step 2: SOC triggers the interrupt by pulling low the mcu_int_in.
	Step 3: Polling output interrupt io mcu_int_out.
	Step 4: Once SOC receives the RGBWIPs interrupt, it means that MCU continue normal operations.
	SOC shall pull-up the mcu_int_in and clear APB_C008=0x00 to end this communication.
	*/
	UINT32 time_sta, time_cur;
	dispd_boe_rgbw_apb_w_control_RBUS dispd_boe_rgbw_apb_w_control_REG;
	dispd_boe_rgbw_apb_w_data_RBUS dispd_boe_rgbw_apb_w_data_REG;
	dispd_boe_rgbw_mcu_control_RBUS dispd_boe_rgbw_mcu_control_REG;
	dispd_boe_rgbw_mcu_st_RBUS dispd_boe_rgbw_mcu_st_RBEG;

	// Step 1
	dispd_boe_rgbw_apb_w_control_REG.regValue = 0;
	dispd_boe_rgbw_apb_w_data_REG.regValue = 0;
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = 0; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0xc008;
	dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = (Act)? 0x11: 0x10; // 1:resume, 0:suspend
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);

	// Step 2
	//wclr status
	dispd_boe_rgbw_mcu_st_RBEG.regValue = IoReg_Read32(DISPD_BOE_RGBW_mcu_st_reg);
	dispd_boe_rgbw_mcu_st_RBEG.mcu_int_st = 1;
	IoReg_Write32(DISPD_BOE_RGBW_mcu_st_reg, dispd_boe_rgbw_mcu_st_RBEG.regValue);
	dispd_boe_rgbw_mcu_control_REG.regValue = IoReg_Read32(DISPD_BOE_RGBW_mcu_control_reg);
	dispd_boe_rgbw_mcu_control_REG.mcu_int_in = 0;
	IoReg_Write32(DISPD_BOE_RGBW_mcu_control_reg, dispd_boe_rgbw_mcu_control_REG.regValue);

	// Step 3
	time_sta = IoReg_Read32(0xB801B6A8);
	do{ // wait b802EC20[24]=1
		dispd_boe_rgbw_mcu_st_RBEG.regValue = IoReg_Read32(DISPD_BOE_RGBW_mcu_st_reg);
		time_cur = IoReg_Read32(0xB801B6A8);
	}while((time_cur - time_sta < 900) && dispd_boe_rgbw_mcu_st_RBEG.mcu_int_st == 0); // IF 10ms or status=1, break.
	
	// Step 4
	dispd_boe_rgbw_mcu_control_REG.mcu_int_in = 1;
	IoReg_Write32(DISPD_BOE_RGBW_mcu_control_reg, dispd_boe_rgbw_mcu_control_REG.regValue);	
	dispd_boe_rgbw_apb_w_control_REG.regValue = 0;
	dispd_boe_rgbw_apb_w_data_REG.regValue = 0;
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = 0; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0xc008;
	dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = 0x00;
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);
}

void drvif_color_set_BOE_RGBW_BootImg(unsigned short *ptr_tab, int w_rate)
{
	/*
	RGBWIP Boot Image steps
	Step1: APB_c000 =0x0, APB_c001 =0x0. (Reset MCU)
	Step2: Download the romcode binary by APB bus from 0000h to 7DFFh.
	Step3: APB_c001 = 0x07 and APB_c000 =0x01 to enable MCU, FW operating start.
	*/
	
	UINT32 i;
	dispd_boe_rgbw_apb_w_control_RBUS dispd_boe_rgbw_apb_w_control_REG;
	dispd_boe_rgbw_apb_w_data_RBUS dispd_boe_rgbw_apb_w_data_REG;
	dispd_boe_rgbw_mcu_control_RBUS dispd_boe_rgbw_mcu_control_REG;
	dispd_boe_rgbw_mcu_st_RBUS dispd_boe_rgbw_mcu_st_REG;

	// Error Check: wclr apb_error
	IoReg_SetBits(DISPD_BOE_RGBW_mcu_st_reg, _BIT31); 

	//Step1: Reset MCU
	dispd_boe_rgbw_apb_w_control_REG.regValue = 0;
	dispd_boe_rgbw_apb_w_data_REG.regValue = 0;
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = 0; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0xc000;
	dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = 0x00;
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);

	//Access 32K SRAM via APB
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = 0; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0xc001;
	dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = 0;
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);

	// Step2: === write table 0~0x7dff ===
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = w_rate; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0x0000;
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	if(w_rate == 0)
	{
		for(i = 0; i < 16128; i++)
		{
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = ptr_tab[i]&0xff;
			IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = (ptr_tab[i]>>8)&0xff;
			IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);
		}
	}
	else if(w_rate == 1)
	{
		for(i = 0; i < 16128; i++)
		{
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = ptr_tab[i]&0xff;
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data1 = (ptr_tab[i]>>8)&0xff;
			IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);
		}
	}
	else if(w_rate == 2)
	{
		for(i = 0; i < 8064; i++)
		{
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = ptr_tab[2*i]&0xff;
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data1 = (ptr_tab[2*i]>>8)&0xff;
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data2 = ptr_tab[2*i+1]&0xff;
			dispd_boe_rgbw_apb_w_data_REG.apb_w_data3 = (ptr_tab[2*i+1]>>8)&0xff;
			IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);
		}
	}

	// Step3: Enable MCU
	// C001 = 7; (Control to MCU)
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = 0; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0xc001;
	dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = 7;
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);
	// wait V-blank
	// C000 = 1; (Reset MCU)
	dispd_boe_rgbw_apb_w_control_REG.apb_w_mode = 0; // 0:addr +1, 1:addr +2, 2:addr +4
	dispd_boe_rgbw_apb_w_control_REG.apb_w_addr= 0xc000;
	dispd_boe_rgbw_apb_w_data_REG.apb_w_data0 = 1;
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_control_reg, dispd_boe_rgbw_apb_w_control_REG.regValue);
	IoReg_Write32(DISPD_BOE_RGBW_APB_w_data_reg, dispd_boe_rgbw_apb_w_data_REG.regValue);

	// Error Check: apb_error
	dispd_boe_rgbw_mcu_st_REG.regValue = IoReg_Read32(DISPD_BOE_RGBW_mcu_st_reg);
	if(dispd_boe_rgbw_mcu_st_REG.apb_error == 1)
		printf("[BOE RGBW Error] apb_error == 1\n");
}
void drvif_color_set_BOE_RGBW_BootOn(unsigned short *ptr_tab, int w_rate)
{
	// 20160627 jyyang
	/*
	< Boot On Flow>
	clear apb_error -> boot image -> check apb_error -> wait 20ms ->
	self_deno_chk_en ON-> disp_en ON-> check self_deno_chk_error
	*/
	unsigned int time_sta, time_cur;
	
	sys_reg_sys_srst3_RBUS sys_reg_sys_srst3_REG;
	sys_reg_sys_clken3_RBUS sys_reg_sys_clken3_REG;
	ppoverlay_display_timing_ctrl1_RBUS display_timing_ctrl1_REG;
	ppoverlay_display_timing_ctrl2_RBUS display_timing_ctrl2_REG;
	od_dma_oddma_pq_cmp_pair_RBUS od_dma_oddma_pq_cmp_pair_REG;

	display_timing_ctrl1_REG.regValue = IoReg_Read32(PPOVERLAY_Display_Timing_CTRL1_reg);
	display_timing_ctrl2_REG.regValue = IoReg_Read32(PPOVERLAY_Display_Timing_CTRL2_reg);
	od_dma_oddma_pq_cmp_pair_REG.regValue = IoReg_Read32(OD_DMA_ODDMA_PQ_CMP_PAIR_reg);
	sys_reg_sys_srst3_REG.regValue = IoReg_Read32(SYS_REG_SYS_SRST3_reg);
	sys_reg_sys_clken3_REG.regValue = IoReg_Read32(SYS_REG_SYS_CLKEN3_reg);

#if 0 // for Experiment
	// Rst_on, Clk_on
	sys_reg_sys_srst3_REG.rstn_d_boe_rgbw_mcu = 1;
	sys_reg_sys_srst3_REG.rstn_d_boe_rgbw_apb = 1;
	sys_reg_sys_srst3_REG.rstn_d_boe_rgbw_pxl = 1;
	sys_reg_sys_srst3_REG.write_data = 1;
	IoReg_Write32(SYS_REG_SYS_SRST3_reg, sys_reg_sys_srst3_REG.regValue);
	sys_reg_sys_clken3_REG.clken_d_boe_rgbw_mcu = 1;
	sys_reg_sys_clken3_REG.clken_d_boe_rgbw_apb= 1;
	sys_reg_sys_clken3_REG.clken_d_boe_rgbw_pxl= 1;
	sys_reg_sys_clken3_REG.write_data = 1;
	IoReg_Write32(SYS_REG_SYS_CLKEN3_reg, sys_reg_sys_clken3_REG.regValue);
	
	// flow: disp_en off -> eco_clk on ->rgbw_en on -> self latency check on -> disp_en on
	display_timing_ctrl1_REG.disp_en = 0;
	IoReg_Write32(PPOVERLAY_Display_Timing_CTRL1_reg, display_timing_ctrl1_REG.regValue);
	od_dma_oddma_pq_cmp_pair_REG.eco_reg_boe_clk_inv = 1;
	IoReg_Write32(OD_DMA_ODDMA_PQ_CMP_PAIR, od_dma_oddma_pq_cmp_pair_REG.regValue);
	display_timing_ctrl2_REG.mplus_rgbw_en = 4; // use rgbw of 0:disable, 1:M+, 2:RTK, 4: BOE
	IoReg_Write32(PPOVERLAY_Display_Timing_CTRL2_reg, display_timing_ctrl2_REG.regValue);
	display_timing_ctrl1_REG.disp_en = 1;
	IoReg_Write32(PPOVERLAY_Display_Timing_CTRL1_reg, display_timing_ctrl1_REG.regValue);
#else
	od_dma_oddma_pq_cmp_pair_REG.eco_reg_boe_clk_inv = 1;
	IoReg_Write32(OD_DMA_ODDMA_PQ_CMP_PAIR, od_dma_oddma_pq_cmp_pair_REG.regValue);
	display_timing_ctrl2_REG.mplus_rgbw_en = 4; // use rgbw of 0:disable, 1:M+, 2:RTK, 4: BOE
	IoReg_Write32(PPOVERLAY_Display_Timing_CTRL2_reg, display_timing_ctrl2_REG.regValue);
#endif

	drvif_color_set_BOE_RGBW_BootImg(ptr_tab, w_rate);
	time_sta = IoReg_Read32(0xB801B6A8);
	do{ 
		time_cur = IoReg_Read32(0xB801B6A8);
	}while(time_cur - time_sta < 1800); // IF 20ms, break.
	IoReg_SetBits(DISPD_BOE_RGBW_APB_latency_reg, _BIT30||_BIT29);
	// -> disp_en ON-> check self_deno_chk_error
}
void drvif_color_set_BOE_RGBW_ModeChange(unsigned short *ptr_tab, int w_rate)
{
	// 20160627 jyyang
	unsigned int self_deno_chk_error;
	drvif_color_set_BOE_RGBW_FW_Action(0); // 0:FW suspend, 1:FW resume
	drvif_color_set_BOE_RGBW_BootImg(ptr_tab, w_rate);
	// check self_deno_chk_error
	IoReg_SetBits(DISPD_BOE_RGBW_mcu_st_reg, _BIT28); // wclr
	self_deno_chk_error = IoReg_Read32(DISPD_BOE_RGBW_mcu_st_reg)&_BIT28 >> 28;
	if(self_deno_chk_error)
		printf("[BOE RGBW Error] self_deno_chk_error == 1\n");
}

void drvif_color_set_BOE_RGBW(int timing, int tab_sel,  int w_rate)
{
	// 20160803 jyyang
	/* ------------------------------------------------
	timing: [0] boot on (before DISP_EN_ON), [1] mode change (after DISP_EN_ON)
	tab_sel: [0] TAB_160713, [1] TAB_160720
	w_rate: [0] write 1 data, [1] write 2 data, [2] write 4 data every time
	------------------------------------------------ */
	extern unsigned short BOE_RGBW_TAB_160713[16128];
	extern unsigned short BOE_RGBW_TAB_160720[16128];
	unsigned short *ptr_tab;
	
        if(tab_sel == 0)
		ptr_tab = BOE_RGBW_TAB_160713;
	else //if(tab_sel == 1)
		ptr_tab = BOE_RGBW_TAB_160720;
	
	if(timing == 0)
		drvif_color_set_BOE_RGBW_BootOn(ptr_tab, w_rate);
	else
		drvif_color_set_BOE_RGBW_ModeChange(ptr_tab, w_rate);
}


